    false,nt"url": null,nt"notes": "This year, in presenting the status of
    waterfowl, we must discuss not only the current situation but also attempt to place
    1966 in proper perspective with past years. The management problem we must solve
    at this meeting is: ''Where do we go from here and how do we get there?" A better
    understanding of where we have been during the past several years will help solve
    this problem. Waterfowl populations, setting harvests and harvest rates, crippling
    losses, and hunter reporting are discussed.",nt"license_title": "License Not
